import React from 'react';
import { topics } from './Topics';

function SubUnitRoutes() {
    subUnitRoutes = topics.map((list, unitIndex) => 
        (<Routes>{list.map((title, subUnitIndex) => 
            (<Route path={`/unit${unitIndex + 1}/${subUnitIndex + 1}`} element={
                <Page unit={unitIndex + 1} index={subUnitIndex + 1} title={title} />}>
            </Route>))}
        </Routes>));}

export default subUnitRoutes;
